using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using UnityEngine;

namespace CMD2.Chisanu.Manager
{
    public class DataStatic
    {
        public const string iconMainButtonManager = "";
    }
    public class UIDragable :UnityInjector.PluginBase
        {
        private bool buttonPressed = false;

        public virtual Rect CheckMouse(Rect buttonRect)
        {
            if (buttonRect.Contains(Event.current.mousePosition))
            {
                if (Event.current.type == EventType.MouseDown)
                {
                    buttonPressed = true;
                }
                if (Event.current.type == EventType.MouseUp)
                {
                    buttonPressed = false;
                }
            }
            if (buttonPressed && Event.current.type == EventType.MouseDrag)
            {
                buttonRect.x += Event.current.delta.x;
                buttonRect.y += Event.current.delta.y;
            }
            return buttonRect;
        }
    }
}
